import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { RestaurantHeader } from '/components';
import {HelperService} from '/services';

export class DesignerPreview extends Component {
    render() {
        return (
            <div>
                <RestaurantHeader
                    {...HelperService.pick(this.props, [
                        'logo',
                        'background_picture',
                        'name'
                    ])}
                />
            </div>
        );
    }
}

DesignerPreview.propTypes = {
    logo: PropTypes.string,
    background_picture : PropTypes.string,
    name: PropTypes.string
};
DesignerPreview.defaultProps = {};
